import './App.css';
import Header from './Header';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Header />
      <Router>
        <Switch>
          <Route path="/">
            <h1>I am the chatpag</h1>
          </Route>
        </Switch>
      </Router >
    </div >
  );
}

export default App;
